import { NativeRouter as Router, Route, Routes as RoutesContainer } from "react-router-native";
import Layout from "./components/layout";
import TodayWorkout from "./screens/today-workout";
import Categories from "./screens/categories";
import ExercisesCategory from "./screens/exercises-category";
import Exercise from "./screens/exercise";

const Routes = () =>
    <Router>
        <Layout>
            <RoutesContainer>
                <Route path="/" element={<Exercise/>}/>
                <Route path="/" element={<TodayWorkout/>}/>
                <Route path="/categories" element={<Categories/>}/>
                <Route path="/categories/:categoryName/exercises" element={<ExercisesCategory/>}/>
                <Route path="/categories/:categoryName/exercises/:exerciseName" element={<Exercise/>}/>
            </RoutesContainer>
        </Layout>
    </Router>

export default Routes;
